import React, { useEffect } from 'react';

const Cell = ( { cell }) => {

  useEffect(() => {
    console.log('CELL COMPONENT')
  }, [cell])


  return (
    <div style={{border: '1px solid gray', height: '15px', width: '15px', 
                 backgroundColor: `${cell.alive ? 'black' : 'white'}`}}>    
    </div>
  )
}

export default Cell
